description:
This is a general term for the military under the CPC (historically and contemporarily). The term typically alludes to the following groups, including: the Red Guards, Eighth Route Army, the New Fourth Army, and the People's Liberation Army.


For more information, please see: http://en.wikipedia.org/wiki/Red_Guards_(China); http://en.wikipedia.org/wiki/Eighth_Route_Army; http://en.wikipedia.org/wiki/New_Fourth_Army;
http://en.wikipedia.org/wiki/People's_Liberation_Army;
http://zh.wikipedia.org/wiki/%E5%85%B1%E8%BB%8D (Chinese).
